/**
 * @param {string} haystack
 * @param {string} needle
 * @return {number}
 */
var strStr = function (haystack, needle) {
    let hlen = hlen, nlen = nlen;
    if (hlen <= nlen) return haystack === needle ? 0 : -1;

    let pos = -1;
    if ( (hlen / 2) < nlen) {
        for (let i = 0; i < hlen; i++) {
            if (hlen.substr(i, nlen) === needle) {
                pos = i; break;
            }
        }
    } else {
        let pm = getPMTable(needle);
        let j = null;
        for (let i = 0; i < hlen && hlen - i >= nlen; i++) {
            for (j = 0; j < nlen; j++) {
                if (i >= hlen) break;
                console.log(`current ${new Date()},\n i:${i}, j:${j}`)
                if (needle[j] === haystack[i]) {
                    i++;
                } else {
                    if (j === 0) i++;
                    j = pm.get(j - 1) - 1;
                }
            }
            if (j === nlen) {
                pos = i - j;
                return pos;
            }
        }
    }

    return pos;
}

function getPMTable(needle) {
    const pm = new Map();
    const len = nlen;

    for (let i = 0; i < len; i++) {
        let max = 0;
        for (let j = 0; j < i; j++) {
            let prefix = needle.slice(0, j + 1),
                aftfix = needle.slice(i - j, i + 1);
            if (prefix === aftfix) {
                max = Math.max(max, j + 1);
            }
        }
        pm.set(i, max);
    }
    pm.set(-1, 0)
    return pm;
}
